import React, { useState } from 'react';

function FitnessSuggestions() {
  const [activityLevel, setActivityLevel] = useState('');
  const [suggestions, setSuggestions] = useState('');

  const suggestExercise = () => {
    let advice = '';
    switch (activityLevel.toLowerCase()) {
      case 'low':
        advice = 'Try light activities like walking or yoga.';
        break;
      case 'medium':
        advice = 'Consider moderate activities like jogging or cycling.';
        break;
      case 'high':
        advice = 'Intense activities like running or weight training are suitable.';
        break;
      default:
        advice = 'Please enter low, medium, or high for activity level.';
    }
    setSuggestions(advice);
  };

  return (
    <div className="container">
      <h1>Physical Fitness Suggestions</h1>
      <label>
        Activity Level (low, medium, high):
        <input
          type="text"
          value={activityLevel}
          onChange={(e) => setActivityLevel(e.target.value)}
          placeholder="Enter activity level"
        />
      </label>
      <button onClick={suggestExercise}>Get Suggestions</button>
      <div className="result">{suggestions}</div>
    </div>
  );
}

export default FitnessSuggestions;
